import React from "react";
import "./App.css";
import Navigbar from "./containers/Navigbar.js";
import Home from "./containers/Home.js";
import MyMapComponent from "./MyMapComponent.js";
function App() {
  return (
    <div>
      <Navigbar />
      <div>
        <Home />
        <div>
          <MyMapComponent />
        </div>
      </div>
    </div>
  );
}

export default App;
